import React, { Component } from 'react';
import {BrowserRouter, Route, Switch, Redirect} from 'react-router-dom';

class App extends Component {
  render() {
    return (
      <div>
        <div className="jumbotron">
          <h1>Exemplo PWA</h1>
        </div>

        <br/>

        <BrowserRouter>
          <Switch>
             <Route name="inicio" path="/" /> 
          </Switch>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
